"use strict";

const BinaryStoreError = require("./binarystore-error.js");

class SoiExceeded extends BinaryStoreError {
  constructor(cause, message) {
    super(message || "Size of uuObject exceeded.", cause);
    this.code = `${BinaryStoreError.ERROR_PREFIX}soiExceeded`;
  }
}

module.exports = SoiExceeded;
